    //Get info of a electric pump
    function getElectricPumpData(string memory object) external view returns(uint,uint,int,int,int,int,string memory){
       
        require(pump[keccak256(abi.encodePacked(object))] == true, "Pump isn't recorded");
        return (dat[keccak256(abi.encodePacked(object))].body_fatt, dat[keccak256(abi.encodePacked(object))].engine_fatt, dat[keccak256(abi.encodePacked(object))].freq, dat[keccak256(abi.encodePacked(object))].maxspeed, dat[keccak256(abi.encodePacked(object))].maxdepth, dat[keccak256(abi.encodePacked(object))].temp,dat[keccak256(abi.encodePacked(object))].lot);
    }


    function isCertificatedBody(uint fatt) view external returns(bool){ 
      
        return body[keccak256(abi.encodePacked(fatt))];
    } 

    function isCertificatedEngine(uint fatt) view external returns(bool){
 
        return engine[keccak256(abi.encodePacked(fatt))];
    } 

    function isCertificatedPump(string memory lot) view external returns(bool){
    
        return pump[keccak256(abi.encodePacked(lot))];
    } 

}
